import React from 'react';
import './App.css';
import { BrowserRouter, Link, Route, Switch } from 'react-router-dom';

import Manatee from './pages/home';
import Narwhal from './pages/contact';

function App() {
  return (
    <div className="wrapper">
      <h1>Marine Mammals</h1>
      <nav>
        <ul>
        <li><Link to="/home">Manatee</Link></li>
        <li><Link to="/contact">Narwhal</Link></li>
        </ul>
      </nav>

      <BrowserRouter>
        <Switch>
          <Route path="/home">
            <Manatee />
          </Route>
          <Route path="/contact">
            <Narwhal />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
